import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Upload from './views/upload.js';

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" component={Upload} />
      </Routes>
    </Router>
  );
}

export default App;
